from fractions import Fraction


class Solution:
    def waysToSplit(self, nums) -> int:
        if len(nums) < 3:
            return 0
        ans, left, mid, right = 0, 0, 0, 0
        orig = [nums[0]]
        for i in range(1, len(nums)):
            orig.append(nums[i])
            nums[i] += nums[i-1]
        total = nums[-1]
        avg = total/3

        for l in range(1, len(nums)-1):
            left = nums[l-1]

            if left > avg:
                break

            # bl, br = l+1, len(nums)-1
            # while bl+1 < br:
            #     bm = math.floor((bl+br)/2)
            #     if nums[bm]-left > left:
            #         br = bm-1
            #     else:
            #         bl = bm
            # print(l, bl)
            # mid = nums[bl]-left
            mid = nums[l]-left
            right = total-mid

            for r in range(l+1, len(nums)):
                if mid > right:
                    break
                # print(orig[:l], orig[l:r], orig[r:])
                # print(left, mid, right)

                if left <= mid and mid <= right:
                    # print('add')
                    ans += 1
                mid = nums[r]-left
                right = total - nums[r]

        return int(math.fmod(ans, math.pow(10, 9)+7))


